package edu.kh.mind.member.model.vo;

public class ProfessionPrice {
	
	private int professionNo;
	private int counselCategoryCode;
	private int counselPrice;
	
	public ProfessionPrice() {
		// TODO Auto-generated constructor stub
	}

	public int getProfessionNo() {
		return professionNo;
	}

	public void setProfessionNo(int professionNo) {
		this.professionNo = professionNo;
	}

	public int getCounselCategoryCode() {
		return counselCategoryCode;
	}

	public void setCounselCategoryCode(int counselCategoryCode) {
		this.counselCategoryCode = counselCategoryCode;
	}

	public int getCounselPrice() {
		return counselPrice;
	}

	public void setCounselPrice(int counselPrice) {
		this.counselPrice = counselPrice;
	}
	
	

}
